import logo from './logo.svg';
import './App.css';
import Heading from "./Heading";
import Banner from "./Banner";
import Tabs from "./Tabs";
import Footer from "./Footer";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">

      <Heading />
      <Banner />
      <Tabs />
      <Footer />
      <Form />
    </div>
  );
}

export default App;
